export const clientWithAuth = (url, token) => async (endpoint, init = {}) => {
  const fullUrl = new URL(endpoint, url);
  const headers = new Headers(init.headers ?? {});
  headers.set('Authorization', `Bearer ${token}`);
  return fetch(fullUrl, {
    ...init,
    headers,
  });
};

