async function fullAckExchange(serverSocket, clientSocket) {
  return new Promise((resolve, reject) => {
    serverSocket.on('hi', (ack) => {
      ack('hola');
    });

    const cb = (response) => {
      if (response === 'hola') {
        resolve();
      } else {
        reject(new Error(`Expected 'hola' but got '${response}'`));
      }
    };

    clientSocket.emit('hi', cb);
  });
}

export async function fullAckExchange(serverSocket, clientSocket) {
  serverSocket.on('hi', (cb) => { cb('hola'); });
  const response = await clientSocket.emitWithAck('hi');
  if (response !== 'hola') {
    throw new Error(`Expected 'hola', got ${JSON.stringify(response)}`);
  }
}

