export async function leaveRoom(socket, room) {
  await new Promise((resolve, reject) => {
    socket.leave(room, (err) => {
      if (err) {
        reject(err);
      } else if (socket.rooms.has(room)) {
        reject(new Error('Socket still in room after leave'));
      } else {
        resolve();
      }
    });
  });
}

